    false,nt"url": null,nt"notes": "This EnviroAtlas web service supports research
    and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas
    ). The EnviroAtlas One Meter-scale Urban Land Cover (MULC) Data were generated individually
    for each EnviroAtlas community. Source imagery varies by community. Land cover classes
    mapped also vary by community and include the following: water, impervious surfaces,
    soil and barren land, trees, shrub, grass and herbaceous, agriculture, orchards,
    woody wetlands, and emergent wetlands. Accuracy assessments were completed for each
    community's classification. For specific information about methods and accuracy
    of each community's land cover classification, consult their individual metadata
    records: Austin, TX (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B91A32A9D-96F5-4FA0-BC97-73BAD5D1F158%7D);
    Des Moines, IA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BA4152198-978D-4C0B-959F-42EABA9C4E1B%7D);
    Durham, NC (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B2FF66877-A037-4693-9718-D1870AA3F084%7D);
    Fresno, CA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B87041CF3-05BC-43C3-82DA-F066267C9871%7D);
    Green Bay, WI (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BD602E7C9-7F53-4C24-8237-746FD3A82CE8%7D);
    Memphis, TN (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B61C69E94-1EB4-42B7-8C56-4D064C05243E%7D);
    Milwaukee, WI (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B9780F143-C78D-4FB6-91C1-DDCDCAE30EBE%7D);
    New Bedford, MA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B9780F143-C78D-4FB6-91C1-DDCDCAE30EBE%7D);
    New York, NY (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BFDB995B6-5B64-422B-A59F-0C272A83216B%7D);
    Phoenix, AZ (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BD556044C-FCCC-4E8B-B157-5E7B8587AEE7%7D);
    Pittsburgh, PA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B2474DC34-035D-495B-99A7-70346BA9CAD5%7D);
    Portland, ME (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BA7C3F637-67AB-4E6E-90C0-04A9EBD6A1C9%7D);
    Paterson, NJ (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B0C356577-EACE-442D-B723-317B518F1885%7D);
    Portland, OR (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B65A8193B-0652-4748-AE8E-FD328CCC448D%7D);
    Tampa, FL (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7B9AD339AD-9243-4EFB-A70B-E2471D96A23E%7D);
    and Woodbine, IA (https://edg.epa.gov/metadata/catalog/search/resource/details.page?uuid=%7BF5ED8E1B-8772-4082-A38B-89810D7C7BA3%7D).
    This dataset was produced by the US EPA to support research and online mapping activities
    related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the
    user to interact with a web-based, easy-to-use, mapping application to view and
    analyze multiple ecosystem services for the contiguous United States. The dataset
    is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
